answer:
You should use regex to find such patters.
For example:
(\d)\1{4,}
This will match a digit and check if it repeats itself 4 more times. This is the case in examples 1, 2, 4 & 5
Another example is: (\d\d)\1{2,}
This will match 2 digits and checks if it repeats itself 2 more times. This is the case in examples 1, 3, 4, 5 & 6

